function Message() {
  let message = [
    {
      content: "Hello ",
      author: "admin",
      side: "left",
    },
    {
      content: "Hi ",
      author: "Ali",
      side: "right",
    },
    {
      content: "How are you ",
      author: "admin",
      side: "left",
    },
    <div className="row left">
      <div className="col-3">
        <div className="left">
          <p>hello</p>
          <span>Ali</span>
        </div>
      </div>
    </div>,

    <div className="row  ">
      <div className="col-3">
        <div className="right">
          <p>hello</p>
          <span>Ali</span>
        </div>
      </div>
    </div>,
    <div className="row ">
      <div className="col-3">
        <div className="left">
          <p>hello</p>
          <span>Ali</span>
        </div>
      </div>
    </div>,
  ];
}
let arr = message.map((message) => {
  return (
    <div className="row">
      <div className="col-3">
        <div className="left">
          <p>{message.content}</p>
          <span>Ali</span>
        </div>
      </div>
    </div>
  );
});

export default Message;
